class rename_in_agent_xaction_xagent extends uvm_agent;
    `uvm_component_utils(rename_in_agent_xaction_xagent)

    rename_in_agent_xaction_xagent_config cfg;
    rename_in_agent_xaction_xmonitor rename_in_agent_xaction_xmon;
    rename_in_agent_xaction_xdriver rename_in_agent_xaction_xdrv;

    function new(string name, uvm_component parent = null);
        super.new(name,parent);
        if (!uvm_config_db#(rename_in_agent_xaction_xagent_config)::get(this, "", "rename_in_agent_xaction_xagent_config", cfg))
            `uvm_fatal("CFGERR", "Could not get xagent_config")

        // Set is_active for monitor (always exists, just needs to know mode for potential internal logic)
        uvm_config_db#(uvm_active_passive_enum)::set(this, "*", "rename_in_agent_xaction_exist_xmonitor", cfg.is_active);
    endfunction

    function void build_phase(uvm_phase phase);
        super.build_phase(phase);
        // Monitor always created (both ACTIVE and PASSIVE modes have monitors)
        rename_in_agent_xaction_xmon = rename_in_agent_xaction_xmonitor::type_id::create($sformatf("%s_sub", cfg.channel_name), this);

        // Driver only created in ACTIVE mode
        if(cfg.is_active == UVM_ACTIVE) begin
            rename_in_agent_xaction_xdrv = rename_in_agent_xaction_xdriver::type_id::create($sformatf("%s.pub", cfg.channel_name), this);
        end
    endfunction

    // Standard UVM connect_phase for TLM connections
    function void connect_phase(uvm_phase phase);
        super.connect_phase(phase);

        // Monitor TLM connection (always present)
        uvmc_tlm #()::connect(rename_in_agent_xaction_xmon.out, $sformatf("%s.sub", cfg.channel_name));

        // Driver TLM connection (only in ACTIVE mode)
        if(cfg.is_active == UVM_ACTIVE) begin
            uvmc_tlm #()::connect(rename_in_agent_xaction_xdrv.in, $sformatf("%s.pub", cfg.channel_name));
        end
    endfunction

endclass


