class WriteBack_in_agent_xaction_xagent_config extends uvm_object;
    // UVM standard configuration using is_active
    uvm_active_passive_enum is_active = UVM_ACTIVE;  // UVM_ACTIVE: monitor+driver, UVM_PASSIVE: monitor only
    string channel_name;    // TLM channel name for both monitor and driver

    `uvm_object_utils_begin(WriteBack_in_agent_xaction_xagent_config)
        `uvm_field_enum(uvm_active_passive_enum, is_active, UVM_DEFAULT)
        `uvm_field_string(channel_name, UVM_DEFAULT)
    `uvm_object_utils_end

    function new(string name = "WriteBack_in_agent_xaction_xagent_config");
        super.new(name);
        this.channel_name = "WriteBack_in_agent_xaction";
    endfunction
endclass

class WriteBack_in_agent_xaction_xagent extends uvm_agent;
    `uvm_component_utils(WriteBack_in_agent_xaction_xagent)

    WriteBack_in_agent_xaction_xagent_config cfg;
    WriteBack_in_agent_xaction_xmonitor WriteBack_in_agent_xaction_xmon;
    WriteBack_in_agent_xaction_xdriver WriteBack_in_agent_xaction_xdrv;

    function new(string name, uvm_component parent = null);
        super.new(name,parent);
        if (!uvm_config_db#(WriteBack_in_agent_xaction_xagent_config)::get(this, "", "WriteBack_in_agent_xaction_xagent_config", cfg))
            `uvm_fatal("CFGERR", "Could not get xagent_config")

        // Set is_active for monitor (always exists, just needs to know mode for potential internal logic)
        uvm_config_db#(uvm_active_passive_enum)::set(this, "*", "WriteBack_in_agent_xaction_exist_xmonitor", cfg.is_active);
    endfunction

    function void build_phase(uvm_phase phase);
        super.build_phase(phase);
        // Monitor always created (both ACTIVE and PASSIVE modes have monitors)
        WriteBack_in_agent_xaction_xmon = WriteBack_in_agent_xaction_xmonitor::type_id::create($sformatf("%s_sub", cfg.channel_name), this);

        // Driver only created in ACTIVE mode
        if(cfg.is_active == UVM_ACTIVE) begin
            WriteBack_in_agent_xaction_xdrv = WriteBack_in_agent_xaction_xdriver::type_id::create($sformatf("%s.pub", cfg.channel_name), this);
        end
    endfunction

    // Standard UVM connect_phase for TLM connections
    function void connect_phase(uvm_phase phase);
        super.connect_phase(phase);

        // Monitor TLM connection (always present)
        uvmc_tlm #()::connect(WriteBack_in_agent_xaction_xmon.out, $sformatf("%s.sub", cfg.channel_name));

        // Driver TLM connection (only in ACTIVE mode)
        if(cfg.is_active == UVM_ACTIVE) begin
            uvmc_tlm #()::connect(WriteBack_in_agent_xaction_xdrv.in, $sformatf("%s.pub", cfg.channel_name));
        end
    endfunction

endclass

